import React from "react"
// import { BrowserRouter as Router, Route, Link } from "react-router-dom"
// const SvenskaSpelApi ="https://api.www.svenskaspel.se/player/sponsorship/autocomplete?search=stockholm&numResponses=20"

class ExerciseForm extends React.Component {

  constructor(props) {
    super(props)
    this.state = {
      count: 0
    }
  }

  addTwoPoints() {
    this.setState(prevState => ({
      count: prevState.count + 2
    }))
  }

  addFivePoints() {
    this.setState(prevState => ({
      count: prevState.count + 5
    }))
  }

  addThreePoints() {
    this.setState(prevState => ({
      count: prevState.count + 3
    }))
  }

  render() {
    return (
      <div>
        <form>
          <label>
            10 Situps (2 p)
            <input type="checkbox" value="2p" onClick={this.addTwoPoints} />
          </label>
          <label>
            15 Burpees (3 p)
            <input type="checkbox" value="3p" onClick={this.addThreePoints} />
          </label>
          <label>
            20 min jogging (5 p)
            <input type="checkbox" value="5p" onClick={this.addFivePoints} />
          </label>
        </form>
      </div>
    )
  }

}

export default ExerciseForm
